import React, { useEffect, useRef } from "react";

const Map = () => {
  const mapRef = useRef(null);

  useEffect(() => {
    const script = document.createElement("script");
    script.src = "https://www.astroviewer.net/widgets/widgets/skymap.js";
    script.async = true;

    window.avSkymapProperties = {
      location: {
        lon: 30.524,
        lat: 50.450,
        name: "Kyiv",
        tz: "Europe/Kiev",
      },
      deco: 16399,
      size: 600,
      bgColor: "#ffffff",
      lang: "en",
    };

    mapRef.current.appendChild(script);
  }, []);

  return (
    <div>
      <h2>Sky Map</h2>
      <div className="sky-map" id="av-skymap" ref={mapRef}></div>
    </div>
  );
};

export default Map;
